import React from 'react';

import './assets/scss/styles-global.scss';

function App() {
  return (
    <>
    <div className='container'>
      <h1 className='titulo'>Busca</h1>
      <div className='filter-search'>
        <input type="text" placeholder='Pesquise...'/>
      </div>

      <div className='card-list'>
      </div>
    </div>

    </>
  );
}

export default App;
